The Kids of Murder High

Sociopolitical Documentary hosted by Ade Adepitan, published by Channel 4 broadcasted as part of CH4 Unreported World series in 2014 - English narration


Information
------------------------------

Ade Adepitan and director Nick Blakemore travel to Honduras to meet the inspirational head teacher who's battling to give his pupils the best chance of survival in one of the most dangerous places on Earth. San Pedro Sula has the highest murder rate in the world. Two notorious gangs - Mara Salvatrucha and Barrio 18 - are fighting for control of the city. The only way out for many families is to attempt the dangerous route into the US. In just four months in the run-up to Unreported World's visit, 2500 unaccompanied children from the city have been arrested crossing illegally into the United States. Adepitan and Blakemore are in ChamelecÃƒÂ³n, at the centre of the gang battle. They are there to meet Hector, an extraordinary head teacher trying to convince local kids that education is the way to a better future, rather than risking their lives with the people smugglers.

